class Solution(object):
    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """

        if len(s) < len(t):
            return 0

        if len(s) == len(t):
            if s == t:
                return 1
            else:
                return 0

        # dp[i] is the number of distinct subsequences of s[:i] that equals t[:j]
        dp = [0] * (len(s) + 1)
        dp[0] = 1
        count = 0
        for c in s:
            if c == t[0]:
                count += 1
            dp[1] = count
            dp[1] += dp[0]
        for i in range(2, len(s) + 1):
            if s[i - 1] == t[0]:
                count += 1
            dp[i] = count
            dp[i] += dp[i - 1]
        return dp[-1]

