class Solution(object):
    def checkPerfectNumber(self, num):
        """
        :type num: int
        :rtype: bool
        """

        if num <= 1:
            return False

        divisors = [1]
        sqrt = int(math.sqrt(num))
        for i in range(2, sqrt + 1):
            if num % i == 0:
                divisors.append(i)
                if num // i != i:
                    divisors.append(num // i)

        return num == sum(divisors) - 1

