                bucket_min[num // bucket_size] = num
                bucket_max[num // bucket_size] = num
            else:
                bucket_min[num // bucket_size] = min(bucket_min[num // bucket_size], num)
                bucket_max[num // bucket_size] = max(bucket_max[num // bucket_size], num)

        prev_max = bucket_max[0]
