class Solution(object):
    def cutOffTree(self, forest):
        """
        :type forest: List[List[int]]
        :rtype: int
        """

        trees = []
        m, n = len(forest), len(forest[0])
        for i in range(m):
            for j in range(n):
                if forest[i][j] > 1:
                    trees.append((forest[i][j], i, j))
        trees.sort(key=lambda x: x[0])

        ans = 0
        curr_r, curr_c = 0, 0
        for h, r, c in trees:
            dist = self.bfs(forest, h, curr_r, curr_c)
            if dist == -1:
                return -1
            ans += dist
            curr_r, curr_c = r, c
        return ans

    def bfs(self, forest, h, r, c):
        m, n = len(forest), len(forest[0])
        q = collections.deque([(r, c)])
        visited = set([(r, c)])
        dist = 0
        while q:
            dist += 1
            for _ in range(len(q)):
                r, c = q.popleft()
                if forest[r][c] > h:
                    if r > 0 and (r-1, c) not in visited:
                        q.append((r-1, c))
                        visited.add((r-1, c))
                    elif c > 0 and (r, c-1) not in visited:
                        q.append((r, c-1))
                        visited.add((r, c-1))
        return dist if (r == 0 and c == 0) else -1

