class Solution(object):
    def strangePrinter(self, s):
        """
        :type s: str
        :rtype: int
        """

        n = len(s)
        if n == 0:
            return 0

        dp = [1] * n
        prev = s[0]
        ans = 1

        for i in range(1, n):
            if s[i] == prev:
                dp[i] = dp[i-1] + 1
            else:
                dp[i] = 1
                prev = s[i]
                ans += 1

        return ans + dp[n-1] - 1 if dp[n-1] > 1 else ans

