        :rtype: int
        """

        # create a dictionary to map roman numerals to their integer values
        roman_dict = {'I': 1, 'V': 5, 'X': 10, 'L': 50, 'C': 100, 'D': 500, 'M': 1000}

        # initialize the result to the last value in the dictionary
        result = roman_dict[s[-1]]

