class Solution(object):
    def numberOfArithmeticSlices(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) < 3:
            return 0

        diff = nums[1] - nums[0]
        count = 0
        ans = 0

        for i in nums[2:]:
            if i - diff == diff:
                count += 1
                ans += count
            else:
                diff = i - diff
                count = 1

        return ans

